"392536":{"id":"392536","name":"Lego Scooby-Doo! Hollywood Assombrada","slug":"lego-scooby-doo-hollywood-assombrada","original_title":"LEGO Scooby-Doo! Haunted Hollywood","overview":"Durante uma viagem a Hollywood, a turma decide visitar o lendário e histórico estúdio Brickton. Ao chegar lá, a Mistério S/A descobre que o estúdio está prestes a ser fechado e vendido para empresários que querem demoli-lo. Para piorar ainda mais a situação, o local está sendo assombrado pelo fantasma de Boris Karnak, um famoso ator de filmes antigos, que aterroriza o estúdio utilizando de personagens que marcaram sua carreira, como: a Múmia, o Zumbi e o Cavaleiro Sem-Cabeça. O fantasma espantou todo o elenco e equipe do filme que poderia salvar o estúdio, agora, resta a turma descobrir o que está realmente acontecendo e impedir que o estúdio seja fechado.","first_air_date":"2016-01-28","runtime":75,"episode_run_time":[75],"vote_average":7.3,"created_by":["Warner Bros. Animation","Hanna-Barbera Productions","LEGO"],"production_companies":[{"name":"Warner Bros. Animation"},{"name":"Hanna-Barbera Productions"},{"name":"LEGO"}],"cast":["Frank Welker","Grey DeLisle","Matthew Lillard","Kate Micucci","Dee Bradley Baker"],"backdrop_path":"https://image.tmdb.org/t/p/original/8YQCybX8it6ILjPvf2xMf2do9Ac.jpg","poster_path":"https://image.tmdb.org/t/p/original/6pv0ULiQ1gT0b8V95RvWg6uC9xY.jpg","certification":"L","genres":["Animação","Família","Comédia","Mistério"],"trailer":"N/A"},
"368940":{"id":"368940","name":"As Aventuras de Robinson Crusoé","slug":"as-aventuras-de-robinson-crusoe","original_title":"Robinson Crusoe","overview":"Em uma pequena e exótica ilha, Tuesday, um papagaio pensa que viver naquele paraíso é muito pouco para ele, e está amadurecendo seu desejo de conhecer o mundo. Depois de uma violenta tempestade, a ilha recebe um refugiado: Robinson Crusoe. O que começa com um jogo de interesses, já que o pássaro vê no rapaz um bilhete para fora da ilha, e o rapaz, em Tuesday, uma forma de sobreviver naquele lugar, vai se desenvolver para uma profunda relação de amizade e companheirismo que vai ensinar aos dois o poder da parceria.","first_air_date":"2016-02-04","runtime":90,"episode_run_time":[90],"vote_average":5.8,"created_by":["uFilm","StudioCanal","nWave Pictures","Illuminata Pictures","Summit Entertainment"],"production_companies":[{"name":"uFilm"},{"name":"StudioCanal"},{"name":"nWave Pictures"},{"name":"Illuminata Pictures"},{"name":"Summit Entertainment"}],"cast":["Ilka Bessin","Dieter Hallervorden","Matthias Schweighöfer","Aylin Tezel","Kaya Yanar"],"backdrop_path":"https://image.tmdb.org/t/p/original/iNpFgFgeD8u00HyloswG2l6L5OV.jpg","poster_path":"https://image.tmdb.org/t/p/original/hDd30gFdkZh3U3pf6m4yEFtX41U.jpg","certification":"L","genres":["Animação","Aventura","Comédia","Família"],"trailer":"N/A"},
