"432131":{"id":"432131","name":"Kuroshitsuji: Book of The Atlantic","slug":"kuroshitsuji-book-of-the-atlantic","original_title":"黒執事 Book of the Atlantic","overview":"Sussurros se transformam em manchetes gritantes no jornal matinal do Conde Ciel Phantomhive enquanto as notícias sobre mortos sendo revividos pegam a sociedade de surpresa. Quando os desagradáveis detalhes chegam ao ouvido de Ciel, ele e Sebastian, o seu excepcional mordomo, com o intuito de examinar os acontecimentos, reservam suas passagens no navio de luxo da Majestic Star Line: o Campania, onde a Sociedade Aurora está a bordo. À medida que as águas do Atlântico invadem o navio, indivíduos misteriosos se reúnem sob a bandeira da Fênix. Ciel e Sebastian podem estar a um passo da verdade, mas será que eles selaram seus destinos investigando um navio que poderá se tornar um caixão flutuante?","first_air_date":"2017-01-21","runtime":101,"episode_run_time":[101],"vote_average":7.6,"created_by":["A-1 Pictures"],"production_companies":[{"name":"A-1 Pictures"}],"cast":["Daisuke Ono","Maaya Sakamoto","田村ゆかり","Junichi Suwabe","Jun Fukuyama"],"backdrop_path":"https://image.tmdb.org/t/p/original/clFQR5zwzDrayMVVe7axo0YLFfh.jpg","poster_path":"https://image.tmdb.org/t/p/original/djIMWgNRhsc35fw88lOW0ehGdKO.jpg","certification":"N/A","genres":["Animação","Ação","Comédia","Fantasia","Mistério"],"trailer":"N/A"},
"413736":{"id":"413736","name":"Monster High: Bem-Vindos a Monster High","slug":"monster-high-bem-vindos-a-monster-high","original_title":"Monster High: Welcome to Monster High","overview":"Já se perguntou como tudo começou? Então, pode entrar que a aula vai começar! Os monstros viviam se escondendo—até mesmo uns dos outros— porque tinham medo de sofrer se os humanos soubessem da existência deles. Mas Draculaura, a filha do Drácula, junto com suas melhores amigas, sonhavam com uma escola onde todos fossem bem-vindos e aceitos. Determinadas a transformarem o sonho em realidade, as monstrinhas viajaram pelo mundo em uma aventura épica para recrutar novos alunos. Mas até mesmo nesse lugar, existem problemas: um zumbi do mal está espalhando a discórdia e todo mundo tem que viver com medo de ter seu segredo revelado. Agora, as monstrinhas tem que salvar a escola para que cada monstro tenha um lugar seguro, onde as diferenças são celebradas!","first_air_date":"2016-08-27","runtime":73,"episode_run_time":[73],"vote_average":6.9,"created_by":["Appa Productions","Mattel"],"production_companies":[{"name":"Appa Productions"},{"name":"Mattel"}],"cast":["Debi Derryberry","Cassandra Lee Morris","Salli Saffioti","Larissa Gallagher","Cristina Milizia"],"backdrop_path":"https://image.tmdb.org/t/p/original/4z5CTTL6qQuDncdUmbwYSwa621D.jpg","poster_path":"https://image.tmdb.org/t/p/original/8HWvsB4pjym9Cu8B08YnLPeTDfo.jpg","certification":"L","genres":["Animação","Família"],"trailer":"N/A"},
