"337302":{"id":"337302","name":"10000 Anos Depois","slug":"10000-anos-depois","original_title":"一万年以后","overview":"Centenas de milhares de anos após o colapso da civilização, o mundo é um deserto “pós-tech” e é habitado por tribos humanóides. A paz estabelecida entre eles é ameaçada pelo retorno de Wushen, um fantasma que muda a forma da tecnologia moderna, ameaçando escravizar a população mundial. Zhuma, uma menina de dez anos de idade é a heroína da história, acompanhada por Zhanggong, seu cachorro leão-como o mastín tibetano e seu avô. Escolhida e ajudada por uma deusa etérea, ela deve reunir aliados das tribos sobreviventes para combater Wushen e impedi-lo de ganhar o controle sobre um poder muito antigo.","first_air_date":"2015-03-27","runtime":96,"episode_run_time":[96],"vote_average":6.7,"created_by":[],"production_companies":[],"cast":["Chong Wang","Yalayam","Joma"],"backdrop_path":"https://image.tmdb.org/t/p/original/k3wsZV39KGqGvKS1l1dLiHKUP6Z.jpg","poster_path":"https://image.tmdb.org/t/p/original/stSbszQGhLcYV8GyTg0tdazE4ye.jpg","certification":"12","genres":["Fantasia","Animação","Ação"],"trailer":"N/A"},
