"477447":{"id":"477447","name":"Overlord: O Rei Zumbi","slug":"overlord-o-rei-zumbi","original_title":"劇場版総集編 オーバーロード 不死者の王【前編】","overview":"A hora final do popular jogo de realidade virtual Yggdrasil chegou. No entanto, Momonga, um poderoso mago e mestre da guilda negra Ainz Ooal Gown, decide passar seus últimos momentos no jogo quando os servidores começam a desligar. Para sua surpresa, apesar do relógio ter atingido a meia-noite, Momonga ainda está totalmente consciente como seu personagem e, além disso, os NPCs parecem ter desenvolvido personalidades próprias! Confrontado com esta situação anormal, Momonga comanda seus leais servos para ajudá-lo a investigar e assumir o controle desse novo mundo, com a esperança de descobrir o que causou esse desenvolvimento e se há outros na mesma situação.","first_air_date":"2017-02-25","runtime":103,"episode_run_time":[103],"vote_average":7.4,"created_by":["Madhouse","KADOKAWA"],"production_companies":[{"name":"Madhouse"},{"name":"KADOKAWA"}],"cast":["Satoshi Hino","原由実","Sumire Uesaka","加藤英美里","Yumi Uchiyama"],"backdrop_path":"https://image.tmdb.org/t/p/original/3U4Vgcd5BwrvnV9C0TKbcl9A9IL.jpg","poster_path":"https://image.tmdb.org/t/p/original/tSPeMmbpIRT5MfPMGdU6qzvb9jW.jpg","certification":"N/A","genres":["Animação","Ação","Aventura","Fantasia"],"trailer":"N/A"},
