"242643":{"id":"242643","name":"Batman: Ataque ao Arkham","slug":"batman-ataque-ao-arkham","original_title":"Batman: Assault on Arkham","overview":"Bem-vindo ao coração sombrio de Gotham City. Do centro das sombras surge o Asilo Arkham, um depósito purulento de tudo que é vil, perigoso e delirante, com uma população que cresce exponencialmente graças ao Cavaleiro das Trevas. Mas quando Batman frustra o mais recente plano do Charada e uma importante parte de uma evidência precisa ser secretamente recuperada no Arkham, a solução vem de uma inesperada fonte: uma equipe secreta de ataque do governo montada no submundo de Gotham City. O assassino Pistoleiro lidera o Esquadrão Suicida: Arlequina, Nevasca, Capitão Bumerangue, Tubarão Rei e Aranha Negra, um bando de desonestos que conhecem o Asilo Arkham e seus residentes muitíssimo bem.","first_air_date":"2014-08-12","runtime":76,"episode_run_time":[76],"vote_average":7.3,"created_by":["Warner Bros. Animation","Warner Premiere","DC Entertainment"],"production_companies":[{"name":"Warner Bros. Animation"},{"name":"Warner Premiere"},{"name":"DC Entertainment"}],"cast":["Kevin Conroy","Neal McDonough","Hynden Walch","Matthew Gray Gubler","Troy Baker"],"backdrop_path":"https://image.tmdb.org/t/p/original/9AciCs5rFHvFbCIqThfq281sUOw.jpg","poster_path":"https://image.tmdb.org/t/p/original/6oW5pC2J0oGSsqhlzEgojhfbjIr.jpg","certification":"12","genres":["Thriller","Animação","Ação","Crime"],"trailer":"N/A"},
"17009":{"id":"17009","name":"Os Jetsons: O Filme","slug":"os-jetsons-o-filme","original_title":"Jetsons: The Movie","overview":"Pela primeira vez, a família mais louca e divertida de todo o espaço vai viver uma aventura completa e emocionante. Quando George Jetson é promovido, ele se muda com toda família para um asteróide distante, cheio de surpresas e novos amigos. Você vai conhecer um Shopping Center do futuro, vai rolar de rir com os jogos de basquete sem gravidade e descobrir que os Grungies, habitantes do asteróide, já sabem como usar a tecnologia em causar danos à ecologia. O Jetsons – é uma incrível produção de 1990, baseado no desenho originais que se tornaram uma das séries de maior sucesso na televisão de todo o mundo.","first_air_date":"1990-06-06","runtime":82,"episode_run_time":[82],"vote_average":6.0,"created_by":["Hanna-Barbera Productions"],"production_companies":[{"name":"Hanna-Barbera Productions"}],"cast":["George O'Hanlon","Mel Blanc","Penny Singleton","Tiffany","Patric Zimmerman"],"backdrop_path":"https://image.tmdb.org/t/p/original/lQdlgYjRoiZPQElWhuIkwCnAxS7.jpg","poster_path":"https://image.tmdb.org/t/p/original/8Rxsb8wNzQNFZQ9Gf9CY6hV4hhZ.jpg","certification":"N/A","genres":["Animação","Comédia","Família","Ficção científica"],"trailer":"N/A"},
