"405894":{"id":"405894","name":"Hora do Recreio: Novas Aventuras na 5ª Série","slug":"hora-do-recreio-novas-aventuras-na-5-serie","original_title":"Recess: Taking the Fifth Grade","overview":"É hora de voltar às aulas na escola da Third Street . A turma da Hora do Recreio agora está na quinta série. Mas eles ficam surpresos quando descobrem algumas mudanças terríveis: não haverá mais lanchonete, o playground fechou e os armários foram arrancados. Para piorar a situação, a nova professora é a horrorosa senhorita Finster. É demais para TJ que decide lutar pelo direito de ter uma escola legal.","first_air_date":"2003-12-09","runtime":62,"episode_run_time":[62],"vote_average":6.5,"created_by":["Disney Television Animation","Paul & Joe Productions"],"production_companies":[{"name":"Disney Television Animation"},{"name":"Paul & Joe Productions"}],"cast":["Rickey D'Shon Collins","Jason Davis","Myles Jeffrey","Ashley Johnson","Courtland Mead"],"backdrop_path":"https://image.tmdb.org/t/p/original/mWmdp69wtnaHIQHpnoqe5U0Nq8U.jpg","poster_path":"https://image.tmdb.org/t/p/original/nHN3oEaXpwhKZ6CZeqkzUOJBZN9.jpg","certification":"N/A","genres":["Família","Comédia","Animação"],"trailer":"N/A"},
"140420":{"id":"140420","name":"O Avião de Papel","slug":"o-aviao-de-papel","original_title":"Paperman","overview":"Nova York, Estados Unidos. Ao ir para o trabalho, um homem se interessa por uma jovem que vê na estação de trem. Entretanto, não consegue falar com ela. Ao chegar ao escritório, ele a vê no prédio ao lado. Sem conseguir chamar sua atenção, ele passa a fazer aviões de papel com o material do trabalho e tenta acertá-los bem na janela do escritório em que ela está, em uma tentativa desesperada para que ela possa, enfim, notá-lo.","first_air_date":"2012-11-02","runtime":7,"episode_run_time":[7],"vote_average":8.0,"created_by":["Walt Disney Pictures","Walt Disney Animation Studios"],"production_companies":[{"name":"Walt Disney Pictures"},{"name":"Walt Disney Animation Studios"}],"cast":["John Kahrs","Kari Wahlgren","Jeff Turley","Jack Goldenberg"],"backdrop_path":"https://image.tmdb.org/t/p/original/fqcBIjhG39YWtDyqntdnavIsr5B.jpg","poster_path":"https://image.tmdb.org/t/p/original/38M9ttjqbLaKsxQYUHVX5BZQ5yE.jpg","certification":"N/A","genres":["Animação","Família","Romance"],"trailer":"N/A"},
"9929":{"id":"9929","name":"Asterix e Cleópatra","slug":"asterix-e-cleopatra","original_title":"Astérix et Cléopâtre","overview":"No Egito, Júlio César insulta Cleópatra ao dizer que sua nação está condenada a viver sob o regime de semiescravidão dos romanos. Decidida a provar que seu povo não está decadente, Cleópatra diz que construirá um magnífico palácio em Alexandria, em apenas 3 meses. Sem saber o que fazer, o engenheiro da obra decide contactar o druida Panoramix, para que ele possa ajudá-lo disponibilizando um pouco da poção mágica que dá força sobrehumana a quem a bebe.","first_air_date":"1968-12-19","runtime":61,"episode_run_time":[61],"vote_average":6.9,"created_by":["Belvision","Dargaud Films"],"production_companies":[{"name":"Belvision"},{"name":"Dargaud Films"}],"cast":["Roger Carel","Jacques Morel","Micheline Dax","Jacques Balutin","Jacques Bodoin"],"backdrop_path":"https://image.tmdb.org/t/p/original/ort14Ott2BvpfmTuhsMUVnSEsWd.jpg","poster_path":"https://image.tmdb.org/t/p/original/fsvNagTYR9n8Edc60fdXffIU1rJ.jpg","certification":"N/A","genres":["Família","Animação","Aventura","Comédia"],"trailer":"N/A"},
"217993":{"id":"217993","name":"Liga da Justiça: Guerra","slug":"liga-da-justica-guerra","original_title":"Justice League: War","overview":"Uma misteriosa figura espreita nas sombras de Gotham City, um guardião silencioso conhecido apenas como o Batman. Enquanto combate o crime e ganha cada vez mais a desconfiança do público, ele enfrenta as injustiças da noite sozinho. Durante uma perseguição a um criminoso, Batman cruza o caminho do arrogante tira intergaláctico, o Lanterna Verde, e a improvável dupla descobre uma ameaça iminente, maior e mais mortal do que qualquer coisa que Terra já tenha encarado.","first_air_date":"2014-01-21","runtime":79,"episode_run_time":[79],"vote_average":7.4,"created_by":["DC Entertainment","Warner Bros. Animation"],"production_companies":[{"name":"DC Entertainment"},{"name":"Warner Bros. Animation"}],"cast":["Michelle Monaghan","Alan Tudyk","Sean Astin","Shemar Moore","Christopher Gorham"],"backdrop_path":"https://image.tmdb.org/t/p/original/uD6AG36ykWAwKfSrLBuaVmpRC0.jpg","poster_path":"https://image.tmdb.org/t/p/original/plYGTcx4bXwPR6DjXfuD83Zl0jx.jpg","certification":"12","genres":["Animação","Ação"],"trailer":"N/A"},
"1121575":{"id":"1121575","name":"Babylon 5: O Caminho","slug":"babylon-5-o-caminho","original_title":"Babylon 5: The Road Home","overview":"Volte para Babylon 5 e acompanhe a épica saga interestelar em The Road Home. Viaje pela galáxia com John Sheridan, que se vê transportado por várias linhas do tempo e realidades alternativas na missão de encontrar seu caminho de volta para casa. Ao longo da jornada, ele encontra alguns rostos familiares e descobre novas revelações cósmicas sobre a história, propósito e significado do Universo.","first_air_date":"2023-08-14","runtime":80,"episode_run_time":[80],"vote_average":6.8,"created_by":["Warner Bros. Animation"],"production_companies":[{"name":"Warner Bros. Animation"}],"cast":["Bruce Boxleitner","Claudia Christian","Peter Jurasik","Bill Mumy","Tracy Scoggins"],"backdrop_path":"https://image.tmdb.org/t/p/original/axIU0Ay88ZSfZHL5AlsQm64Bcb8.jpg","poster_path":"https://image.tmdb.org/t/p/original/7BcIRtnOOY1iOQtsF4DyWo38bLr.jpg","certification":"14","genres":["Animação","Ficção científica","Ação","Aventura"],"trailer":"N/A"},
"521296":{"id":"521296","name":"Okko e Os Espíritos","slug":"okko-e-os-espiritos","original_title":"若おかみは小学生！","overview":"Após a morte de seus pais, a jovem Okko vai viver com sua avó, dona de um tradicional hotel japonês no campo. A garota faz uma descoberta incrível sobre o hotel: existem espíritos bastante amigáveis que ali vivem e só ela os pode ver. Okko provavelmente tocará o hotel de sua avó no futuro, portanto se dedica a cuidar do hotel e trabalhar em diversas atividades ali. Não será fácil lidar com novos hóspedes que acabam de chegar ao hotel, apesar de que o lema do lugar é receber todos indistintamente e não rejeitar ninguém. É um desafio para Okko, mas também a chave de um importante aprendizado sobre a vida. Baseado na obra infantil de Hiroko Reijo, ilustrado por Asami.","first_air_date":"2018-09-12","runtime":94,"episode_run_time":[94],"vote_average":7.2,"created_by":["Madhouse","DLE","Wakaokami Project"],"production_companies":[{"name":"Madhouse"},{"name":"DLE"},{"name":"Wakaokami Project"}],"cast":["小林星蘭","Nana Mizuki","松田颯水","遠藤璃菜","小桜エツコ"],"backdrop_path":"https://image.tmdb.org/t/p/original/gkhnCTG6IvmUVTUMfR1XXFh5fae.jpg","poster_path":"https://image.tmdb.org/t/p/original/lYai9w83Ega6FiznyriW49rFXUY.jpg","certification":"N/A","genres":["Animação","Comédia","Fantasia","Família","Drama","Aventura"],"trailer":"N/A"},
