"16808":{"id":"16808","name":"Pokémon Ranger e o Lendário Templo do Mar","slug":"pokemon-ranger-e-o-lendario-templo-do-mar","original_title":"劇場版ポケットモンスター アドバンスジェネレーション ポケモンレンジャーと蒼海の王子 マナフィ","overview":"A história começa quando o Pokémon Ranger Jackie é mandado para encontrar informações sobre Manaphy. Ele consegue pegar o \"ovo\" de volta, que está Manaphy (não era para ser um Phione?). Ash e cia chegam em uma cidade, e sem saber, se encontram com Jackie. May desconfia que tem algo estranho naquela \"casa\", e assim, descobre Manaphy. May fica sendo uma mãe para Manaphy, mas será que ela seguirá a sua jornada com seu novo companheiro? Lembre Phione não evolui para Manaphy Phione é um Resultado de um Cruzamento (Breeding). May liga-se a Manaphy no filme, agindo como \"mãe\" do pequeno pokemon.","first_air_date":"2006-07-15","runtime":107,"episode_run_time":[107],"vote_average":6.5,"created_by":["jeki","Media Factory","OLM","Pikachu Project","Shogakukan Production","TV Tokyo","The Pokémon Company","TakaraTomy","Shogakukan"],"production_companies":[{"name":"jeki"},{"name":"Media Factory"},{"name":"OLM"},{"name":"Pikachu Project"},{"name":"Shogakukan Production"},{"name":"TV Tokyo"},{"name":"The Pokémon Company"},{"name":"TakaraTomy"},{"name":"Shogakukan"}],"cast":["松本梨香","Ikue Otani","うえだゆうじ","KAORI","山田ふしぎ"],"backdrop_path":"https://image.tmdb.org/t/p/original/yLJeOFvP0DidEqkoSSrQFQh8J47.jpg","poster_path":"https://image.tmdb.org/t/p/original/xv7CC8DTSVoE4QSF3CUmXh575zT.jpg","certification":"N/A","genres":["Família","Animação","Ação","Aventura","Fantasia","Ficção científica"],"trailer":"N/A"},
"539626":{"id":"539626","name":"Combatentes da Liberdade: Ray","slug":"combatentes-da-liberdade-ray","original_title":"Freedom Fighters: The Ray","overview":"Terra X é uma das muitas realidades do multiverso, com uma diferença gritante da nossa terra: os nazistas ganharam a segunda guerra mundial! Liderados por Ray, um grupo de heróis conhecido como Combatentes da Liberdade lidera a batalha contra a tirania. Mas quando Ray é transportado para a Terra para salvar a sua própria vida, ele passa os seus poderes ao seu equivalente desavisado, Ray Terrill. Supercarregado com habilidades super-humanas, o recém-batizado Ray deve se adaptar e superar os desafios da luta contra o crime, embora com a pequena ajuda de Flash e Arqueiro Verde. Preparado e pronto para lutar, Ray agora enfrenta a sua maior batalha: voltar à Terra X para liderar os Combatentes da Liberdade contra Overgirl e os seus capangas nazistas do mal!","first_air_date":"2018-08-28","runtime":72,"episode_run_time":[72],"vote_average":6.1,"created_by":["Warner Bros. Animation","DC Entertainment","Berlanti Productions","Blue Ribbon Content"],"production_companies":[{"name":"Warner Bros. Animation"},{"name":"DC Entertainment"},{"name":"Berlanti Productions"},{"name":"Blue Ribbon Content"}],"cast":["Russell Tovey","Megalyn Echikunwoke","Echo Kellum","Iddo Goldberg","Sunil Malhotra"],"backdrop_path":"https://image.tmdb.org/t/p/original/OBVPrR3htm4WC6v6SsUSKZRvFD.jpg","poster_path":"https://image.tmdb.org/t/p/original/vH6xVfAfgE1Toe5CMjHit8DPqMQ.jpg","certification":"14","genres":["Animação","Ação","Fantasia"],"trailer":"N/A"},
