"323027":{"id":"323027","name":"Liga da Justiça: Deuses e Monstros","slug":"liga-da-justica-deuses-e-monstros","original_title":"Justice League: Gods and Monsters","overview":"Viaje a uma realidade divergente, onde a Liga da Justiça protege o planeta – mas responde apenas a ela própria. Utilizando métodos de intimidação e medo, estes Superman, Batman e Mulher-Maravilha usam força bruta em nome da justiça. Neste universo alternativo, Superman não foi criado pelos Kents em Smallville, o Cavaleiro das Sombras não é Bruce Wayne, e Mulher Maravilha não é uma guerreira amazona de Themyscira. Quando um grupo de cientistas famosos passam por “acidentes”, uma força-tarefa do governo é acionada e segue uma trilha de pistas que os leva à Liga – mas será que há mais alguém nas sombras operando esse estratagema? Trata-se de um jogo de altas apostas envolvendo intrigas, mistérios e ação, que pretende responder a pergunta: Como você leva a justiça para aqueles que estão acima da lei?","first_air_date":"2015-06-18","runtime":72,"episode_run_time":[72],"vote_average":7.1,"created_by":["Warner Bros. Animation","DC Entertainment","Warner Premiere"],"production_companies":[{"name":"Warner Bros. Animation"},{"name":"DC Entertainment"},{"name":"Warner Premiere"}],"cast":["Benjamin Bratt","Michael C. Hall","Tamara Taylor","Jason Isaacs","C. Thomas Howell"],"backdrop_path":"https://image.tmdb.org/t/p/original/biu21pZCpfe6dv9rrl23k6m6MXJ.jpg","poster_path":"https://image.tmdb.org/t/p/original/su5lmAMy438kYaAjJeGk2k17jnZ.jpg","certification":"12","genres":["Ação","Animação","Fantasia","Aventura","Ficção científica"],"trailer":"N/A"},
