"1012652":{"id":"1012652","name":"PSYCHO-PASS: Providence","slug":"psycho-pass-providence","original_title":"劇場版 PSYCHO-PASS サイコパス PROVIDENCE","overview":"Em janeiro de 2118, a Inspetora-Chefe do Departamento de Investigação Criminal, Akane Tsunemori, recebe um relatório de um incidente em um navio estrangeiro: o corpo da professora Milicia Stronskaya foi encontrado. Por trás do incidente está um grupo conhecido como os \"Peacebreakers\", uma organização paramilitar estrangeira e uma nova ameaça externa que está atrás de documentos de pesquisa da professora conhecidos como \"Documento Stronskaya\". Juntamente com Shinya Kogami, um ex-fugitivo do Departamento de Investigação Criminal, Akane enfrenta um caso que rapidamente fica mais intenso do que ela jamais imaginou. Os Documentos Stronskaya podem revelar uma verdade que abalaria o governo japonês e o Sistema Sibyl até o âmago.","first_air_date":"2023-05-12","runtime":121,"episode_run_time":[121],"vote_average":6.9,"created_by":["Production I.G","TOHO","Fuji Television Network","Sony Music Entertainment","MAGNET","dentsu","Nitroplus"],"production_companies":[{"name":"Production I.G"},{"name":"TOHO"},{"name":"Fuji Television Network"},{"name":"Sony Music Entertainment"},{"name":"MAGNET"},{"name":"dentsu"},{"name":"Nitroplus"}],"cast":["Kana Hanazawa","関智一","野島健児","Shizuka Ito","Miyuki Sawashiro"],"backdrop_path":"https://image.tmdb.org/t/p/original/6TwCGF6M9di9yFxFmg76F90It2f.jpg","poster_path":"https://image.tmdb.org/t/p/original/loQnGx81zO3RDf1VmNiGZf60mCg.jpg","certification":"N/A","genres":["Animação","Crime","Mistério","Thriller"],"trailer":"N/A"},
