"67596":{"id":"67596","name":"O Flautista Encantado","slug":"o-flautista-encantado","original_title":"The Pied Piper","overview":"A cidade de Hamelin estava sofrendo com uma infestação de ratos. Um dia, chega à cidade um homem dizendo ter a solução para o problema. Prometeram-lhe um bom pagamento em troca da eliminação dos ratos: um saco de moedas de ouro. O homem aceitou o acordo, pegou uma flauta e hipnotizou os ratos, levando-os para fora da cidade. Porém, os habitantes de Hamelin não cumpriram o acordo, mas sofreram as consequências disso.","first_air_date":"1933-09-16","runtime":8,"episode_run_time":[8],"vote_average":6.4,"created_by":["Walt Disney Productions"],"production_companies":[{"name":"Walt Disney Productions"}],"cast":["George Gramlich","Allan Watson","Marion Darlington","Harriette Haddon"],"backdrop_path":"https://image.tmdb.org/t/p/original/i9mazx93YFVCyYJGsDgG5LRBQL6.jpg","poster_path":"https://image.tmdb.org/t/p/original/hQvHns77XrCv4cTULEvSgVr4zbV.jpg","certification":"N/A","genres":["Animação","Música"],"trailer":"N/A"},
