"582881":{"id":"582881","name":"Os Olhos de Cabul","slug":"os-olhos-de-cabul","original_title":"Les Hirondelles de Kaboul","overview":"Verão de 1998, Cabul em ruínas é ocupada pelos talibãs. Atiq e Mussarat estão casados ​​há muitos anos e quase não falam mais um com o outro. Ele não apoia sua vida como guarda de prisão para mulheres. Ela, sofrendo de uma doença incurável, está em agonia. Mohsen e Zunaira são jovens, eles se amam profundamente, apesar da violência e da miséria cotidiana, eles querem acreditar no futuro. Um movimento insensato de Mohsen transformará seu destino em tragédia.","first_air_date":"2019-09-04","runtime":81,"episode_run_time":[81],"vote_average":7.8,"created_by":["Les Armateurs","Close Up Films","ARTE","RTS","KNM","Studio 352","Melusine Productions"],"production_companies":[{"name":"Les Armateurs"},{"name":"Close Up Films"},{"name":"ARTE"},{"name":"RTS"},{"name":"KNM"},{"name":"Studio 352"},{"name":"Melusine Productions"}],"cast":["Simon Abkarian","Zita Hanrot","Swann Arlaud","Hiam Abbass","Jean-Claude Deret"],"backdrop_path":"https://image.tmdb.org/t/p/original/ip8BfpLQJ9RKCJcJgAyw8aD28P5.jpg","poster_path":"https://image.tmdb.org/t/p/original/bnhxXbK8DhUMPu8FDBaF0hNsA33.jpg","certification":"N/A","genres":["Animação","Drama"],"trailer":"N/A"},
"915403":{"id":"915403","name":"Gridman Universe","slug":"gridman-universe","original_title":"グリッドマン ユニバース","overview":"Há algum tempo, este mundo foi criado por uma garota, e depois destruído por ela para desabafar sua frustração com a realidade. Foi Gridman, o Hiper Agente, o monstro humano que ela criou, Yuta Hibiki e seus amigos que salvaram seu coração. Yuta Hibiki tinha acabado de se tornar um estudante do segundo ano do ensino médio e decidiu revelar seus sentimentos à sua colega de classe, Rikka. Porém, Kaiju apareceu de repente e começou a atacar a cidade. Gridman voltou da dimensão alternativa e disse a Yuta que mundos de diferentes dimensões que antes estavam em harmonia estavam perdendo rapidamente o equilíbrio. Quando o dragão vermelho Dyan Rex, os apoiadores do Gridman chamados “Neon Genesis Junior High Students” e os residentes de um mundo alternativo, Yomogi Asanaka e seus amigos apareceram um por um, Yuta foi mais uma vez apanhado em uma grande crise…","first_air_date":"2023-03-24","runtime":118,"episode_run_time":[118],"vote_average":8.3,"created_by":["TRIGGER","Tsuburaya Productions","TOHO","Pony Canyon","Graphinica"],"production_companies":[{"name":"TRIGGER"},{"name":"Tsuburaya Productions"},{"name":"TOHO"},{"name":"Pony Canyon"},{"name":"Graphinica"}],"cast":["Hikaru Midorikawa","Yuya Hirose","Soma Saito","宮本侑芽","Junya Enoki"],"backdrop_path":"https://image.tmdb.org/t/p/original/cu4RB859vbrim0GCM0swmGAKN70.jpg","poster_path":"https://image.tmdb.org/t/p/original/dPALPAJoQ6y9W8TTMvem50vU2ID.jpg","certification":"N/A","genres":["Animação","Ação","Ficção científica"],"trailer":"pzcA4sQnRRI"},
