"454549":{"id":"454549","name":"Zumbilênio: O Parque dos Monstros","slug":"zumbilenio-o-parque-dos-monstros","original_title":"Zombillénium","overview":"O Zumbilênio é um parque de diversões como nenhum outro: Somente legítimos lobisomens, vampiros, zumbis e outros cidadãos da comunidade dos mortos-vivos trabalham nele... Por toda a eternidade. Um dia, Hector, um jovem inspetor de qualidade, decide analisar a segurança do parque e ameaça fechá-lo. Francis, o vampiro que administra o parque, se vê sem opção além de mordê-lo para proteger seu negócio. E assim, Hector está contratado. Ele então conhece seus colegas de trabalho e Gretchen, uma bruxa estagiária do parque, que ensina a ele a cultura do seu novo ambiente de trabalho. Hector pode ser a última chance do Zumbilênio: O número de público está caindo e o parque precisa de uma nova atração especial para evitar a falência. Mas, no fundo, Hector, não para de pensar em sua jovem filha, Lucie, que espera por ele no mundo “real”.","first_air_date":"2017-10-18","runtime":1,"episode_run_time":[1],"vote_average":7.0,"created_by":["Maybe Movies","Belvision","Dupuis","France 3 Cinéma","Gébéka Films","2 Minutes","Pipangaï Production","Gao Shan Pictures","22D Music","Bonnie Music","RTBF"],"production_companies":[{"name":"Maybe Movies"},{"name":"Belvision"},{"name":"Dupuis"},{"name":"France 3 Cinéma"},{"name":"Gébéka Films"},{"name":"2 Minutes"},{"name":"Pipangaï Production"},{"name":"Gao Shan Pictures"},{"name":"22D Music"},{"name":"Bonnie Music"},{"name":"RTBF"}],"cast":["Fily Keita","Emmanuel Curtil","Maelys Ricordeau","Alexis Tomassian","Arthur de Pins"],"backdrop_path":"https://image.tmdb.org/t/p/original/688EDSOOC2WR2kwjvmbmjmMIMxd.jpg","poster_path":"https://image.tmdb.org/t/p/original/w2HamcBWs8Uv2Xgt2nNPlOtyczU.jpg","certification":"N/A","genres":["Comédia","Animação","Fantasia"],"trailer":"N/A"},
