"19323":{"id":"19323","name":"Superman: Brainiac Ataca","slug":"superman-brainiac-ataca","original_title":"Superman: Brainiac Attacks","overview":"Superman, prestes a revelar sua identidade e seus sentimentos por Lois Lane, de repente é interrompido pela ameaça de Brainiac, um poderoso computador programado para dominar o mundo, que usa armamento de Lex Luthor (projetado para defender a Terra de meteoros) para atacar os humanos. Derrotado pelo herói numa primeira luta, Brainiac é revivido por Luthor que faz um acordo com ele e lhe dá um fragmento de kryptonita. Na nova luta entre Superman e Brainiac, Lois Lane é mortalmente ferida por um raio de força que a contamina com a radiação de kryptonita. Superman vai à Fortaleza da Solidão e descobre que o mineral que poderá salvá-la encontra-se na letal Zona Fantasma.","first_air_date":"2006-06-20","runtime":75,"episode_run_time":[75],"vote_average":6.1,"created_by":["DC","Warner Bros. Animation"],"production_companies":[{"name":"DC"},{"name":"Warner Bros. Animation"}],"cast":["Tim Daly","Dana Delany","Powers Boothe","Lance Henriksen","George Dzundza"],"backdrop_path":"https://image.tmdb.org/t/p/original/m0P2NN1a0XMtu4oUe3hcVDVCCqD.jpg","poster_path":"https://image.tmdb.org/t/p/original/2BLecfWT151cJJcACltXrmPqu4t.jpg","certification":"12","genres":["Animação","Ação","Família","Ficção científica"],"trailer":"N/A"},
