"76346":{"id":"76346","name":"A História de Nessie","slug":"a-historia-de-nessie","original_title":"The Ballad of Nessie","overview":"Uma criatura lendária e amigável chamado Nessie vive feliz em um pequeno lago com seu amigo MacQuack, um pato de borracha. Quando um construtor rico compra o lago e o terreno circundante para construir um campo de mini-golfe, Nessie é forçada a procurar um novo lar.","first_air_date":"2011-04-13","runtime":5,"episode_run_time":[5],"vote_average":6.7,"created_by":["Walt Disney Pictures","Walt Disney Animation Studios"],"production_companies":[{"name":"Walt Disney Pictures"},{"name":"Walt Disney Animation Studios"}],"cast":["Billy Connolly","Kevin Deters"],"backdrop_path":"https://image.tmdb.org/t/p/original/qXB3EyXyCis0FrIFBdTb3hwm9q.jpg","poster_path":"https://image.tmdb.org/t/p/original/pvSdPkQSsXVHCLWE92RMvZcB8GA.jpg","certification":"L","genres":["Animação","Família","Fantasia"],"trailer":"N/A"},
"40246":{"id":"40246","name":"Natal em Julho","slug":"natal-em-julho","original_title":"Rudolph and Frosty's Christmas in July","overview":"Anos atrás o Polo Norte era governado pela fada Lady Boreal, que concedeu à rena Rudolph um nariz brilhante e mágico para proteger Papai Noel de Winterbolt, um mago malvado. Anos depois, Rudolph e seu amigo Frosty, um boneco de neve, são chamados para salvar um circo das garras de Winterbolt.","first_air_date":"1979-07-01","runtime":97,"episode_run_time":[97],"vote_average":6.5,"created_by":["Rankin/Bass Productions"],"production_companies":[{"name":"Rankin/Bass Productions"}],"cast":["Red Buttons","Ethel Merman","Mickey Rooney","Alan Sues","Jackie Vernon"],"backdrop_path":"https://image.tmdb.org/t/p/original/9bBUH5OfA19jri8YOpXTty1dB0v.jpg","poster_path":"https://image.tmdb.org/t/p/original/3BfpQ4trGB6aEIIirL7SikStHRU.jpg","certification":"N/A","genres":["Animação","Fantasia","Família","Cinema TV"],"trailer":"N/A"},
"84331":{"id":"84331","name":"Hora do Recreio: O Início de Tudo","slug":"hora-do-recreio-o-inicio-de-tudo","original_title":"Recess: All Growed Down","overview":"Espiando o passado dos seus personagens preferidos, você vai acompanhar as lembranças da turma quando eles chegaram à escola da Third Street. Eles são convidados pela professora a passar um dia tomando conta do terrível Jardim da Infância. Os pequenos são impossíveis: não escrevem, não jogam, ficam presos no playground e são totalmente indisciplinados. Os pequenos se revoltam e liderados pelo chefe Fedorento \"sequestram\" TJ . A turma toda fica em pânico – TJ está desaparecido. Depois de muita confusão, TJ e seus amigos percebem que grandões e criancinhas podem ser bons amigos. Afinal um dia eles também foram do jardim da infância.","first_air_date":"2003-12-09","runtime":61,"episode_run_time":[61],"vote_average":6.5,"created_by":["Paul & Joe Productions","Disney Television Animation"],"production_companies":[{"name":"Paul & Joe Productions"},{"name":"Disney Television Animation"}],"cast":["Myles Jeffrey","Pamela Adlon","Dabney Coleman","Ashley Johnson","Allyce Beasley"],"backdrop_path":"https://image.tmdb.org/t/p/original/xJR6NoYFDzE0RhgpSixgg0T2ycW.jpg","poster_path":"https://image.tmdb.org/t/p/original/in3xkA0aJZK2TtLQlNlzs8BY53A.jpg","certification":"N/A","genres":["Família","Comédia","Animação"],"trailer":"N/A"},
