"39230":{"id":"39230","name":"Mobile Suit Gundam III: Confrontos no Espaço","slug":"mobile-suit-gundam-iii-confrontos-no-espaco","original_title":"機動戦士ガンダム III めぐりあい宇宙編","overview":"A Guerra de Um Ano está chegando ao fim, conforme as forças de Zeon recuam para o espaço. Amuro aprende muito mais sobre suas habilidades Newtype e tenta usá-las da melhor maneira possível. Ele é levado ao seu limite com o encontro do infame Char Aznable mais uma vez. Ele também se apaixona por uma mulher misteriosa chamada Lalah Sune, que conhece todo o potencial das habilidades Newtype. A maior batalha está prestes a começar, como muitos entes queridos cair para o poder da guerra. Irá a Federação da Terra derrotar o Principado de Zeon? Ou eles vão falhar? Char conseguirá provar que ele é um Newtype melhor que Amuro? Tudo será respondido agora...","first_air_date":"1982-03-13","runtime":140,"episode_run_time":[140],"vote_average":7.5,"created_by":["SUNRISE"],"production_companies":[{"name":"SUNRISE"}],"cast":["古谷徹","池田秀一","鈴置洋孝","鈴木清信","白石冬美"],"backdrop_path":"https://image.tmdb.org/t/p/original/wTsYCRokwwr84nIhDP13rZFhvpI.jpg","poster_path":"https://image.tmdb.org/t/p/original/eYcPxGyrrj2wACuEbueWWMeXmY9.jpg","certification":"N/A","genres":["Animação","Ficção científica","Ação"],"trailer":"N/A"},
