"460135":{"id":"460135","name":"Lego DC Super Hero Girls: Controle Mental","slug":"lego-dc-super-hero-girls-controle-mental","original_title":"LEGO DC Super Hero Girls: Brain Drain","overview":"Junte-se a LEGO® DC Super Hero Girls nesta incrível animação cheia de aventura e ação! Jogos mentais e perturbadores estão apenas começando quando Supergirl, Mulher-Maravilha e Batgirl não se lembram de algumas coisas erradas pelas quais estão sendo responsabilizadas. A quem nossas garotas podem recorrer quando Bumblebee, Katana e outras alunas de Super Hero High também não podem ajudar? Será necessário mais do que super poderes para desmantelar essa confusão e descobrir o que ou quem está por trás de toda essa confusão. Prepare-se e coloque sua capa para mais uma aventura LEGO® repleta de garotas poderosas!","first_air_date":"2017-07-12","runtime":75,"episode_run_time":[75],"vote_average":6.5,"created_by":["Warner Bros. Animation","DC Entertainment","LEGO"],"production_companies":[{"name":"Warner Bros. Animation"},{"name":"DC Entertainment"},{"name":"LEGO"}],"cast":["Grey DeLisle","Tara Strong","Anais Fairweather","Teala Dunn","Stephanie Sheh"],"backdrop_path":"https://image.tmdb.org/t/p/original/4iKsPyyKyoeK30y25qMzR1X7XnJ.jpg","poster_path":"https://image.tmdb.org/t/p/original/aJOvuFnDREK9UThM79fGrvE2EXa.jpg","certification":"L","genres":["Animação"],"trailer":"N/A"},
