"37048":{"id":"37048","name":"Mobile Suit Gundam 00: A Wakening of the Trailblazer","slug":"mobile-suit-gundam-00-a-wakening-of-the-trailblazer","original_title":"劇場版 機動戦士ガンダム00 -A wakening of the Trailblazer-","overview":"A série começa em 2307 AD. AD do calendário Gregoriano. Nesta era os combustíveis fósseis acabaram e a humanidade na Terra, dividida basicamente entre três grandes blocos de poder, a Aliança Econômica Internacional ou UNION centralizada nos Estados Unidos, a Liga Reformista da Humanidade centralizada na China, Rússia e Índia, e a nova União Européia, AEU, desenvolveu um sistema de captação de energia solar composto por um anel externo no planeta com aproximadamente 50 mil quilômetros de comprimento. Mesmo no século XXIII a humanidade continua criando conflitos entre os blocos de poder e, cansados deste cenário de guerras sem fim, uma organização paramilitar possuindo 4 mobile suits chamados Gundam, resolveu lutar para unificar o mundo em um único bloco e acabar com todos as guerras de uma vez por todas. Esta organização se chama Celestial Being.","first_air_date":"2010-09-18","runtime":123,"episode_run_time":[123],"vote_average":6.3,"created_by":["SUNRISE","Bandai Visual","Sotsu","MBS"],"production_companies":[{"name":"SUNRISE"},{"name":"Bandai Visual"},{"name":"Sotsu"},{"name":"MBS"}],"cast":["Mamoru Miyano","Shin'ichirō Miki","吉野裕行","Hiroshi Kamiya","勝地涼"],"backdrop_path":"https://image.tmdb.org/t/p/original/v7ha9Qwc5pCAvS5mMVjOPHCQVR5.jpg","poster_path":"https://image.tmdb.org/t/p/original/pGfKtbinKYzsfwVVTF628nQtVL8.jpg","certification":"N/A","genres":["Ação","Animação","Drama","Ficção científica","Guerra"],"trailer":"N/A"},
